"135271":{"id":"135271","name":"Gostaria de uma Xícara de Café?","slug":"gostaria-de-uma-xicara-de-cafe","original_title":"커피 한잔 할까요?","overview":"Em um momento de inspiração, um jovem repensa sua vida e decide se tornar barista. Nessa jornada, ele vai aprender sobre várias outras coisas além do café.","first_air_date":"2021-10-24","episode_run_time":30,"vote_average":6.1,"number_of_seasons":1,"number_of_episodes":12,"created_by":["No Jung-wook"],"production_companies":["Kakao Entertainment"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/r0T2XJzirUysXm4kXckNEbC0wAc.jpg","poster_path":"https://image.tmdb.org/t/p/original/pzbBMt3SskpaMeH0r9zOrNiFzWr.jpg","cast":["옹성우","박호산","서영희","Choo Ye-jin","Song Jae-ryong"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/jZAZlTHrWgR61xW7NV1kNBJeYNq.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/jZAZlTHrWgR61xW7NV1kNBJeYNq.jpg","air_date":"2021-10-24","episode_count":12,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A dose divina","overview":"Depois de tomar um café incrível, Kang Go-bi decide repensar a vida. Mas sua insistência incomoda Park Seok, o dono da cafeteria.","air_date":"2021-10-24","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/m8NCZLVd0qyoF8oQ9WspwwStRIz.jpg","vote_average":0},"2":{"name":"Go-Bi, Go-Bi? Go-Bi!","overview":"Go-bi não desiste e continua pedindo um emprego na cafeteria, onde recebe duras críticas.","air_date":"2021-10-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/8yNy25c7ubumgpG7gOGHJmXwDOE.jpg","vote_average":0},"3":{"name":"Voldemort","overview":"Um cliente chato resolve fazer a cafeteria de escritório. Go-bi tenta de tudo para mudar a situação.","air_date":"2021-10-31","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/jNEwrqFyu3V9stjuADubVmeqVr0.jpg","vote_average":0},"4":{"name":"Absoluto, mas relativo","overview":"Sempre ocupada, Kim Joo-hee vai à cafeteria do namorado e escuta um pedido difícil do ex-marido. Ela acaba tendo um dia péssimo.","air_date":"2021-11-04","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/jY4r0q4ZXE0nbcdHOqL0NSTcw6h.jpg","vote_average":0},"5":{"name":"Não se esqueça de mim","overview":"Go-bi e o Sr. Park encontram uma máquina especial que reúne as pessoas para tomar café juntas e contar suas histórias.","air_date":"2021-11-07","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/byzDMnH5OQJnthSeZk4DBHzK3bJ.jpg","vote_average":0},"6":{"name":"Garçom","overview":"Go-bi está cada vez mais preocupado com a falta de clientes na cafeteria. Ele pede para incluir um item no menu, mas é mal interpretado.","air_date":"2021-11-11","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/gvtW8fr7ZlKFKoK9pPLFgBD8LWg.jpg","vote_average":0},"7":{"name":"Misturas e combinações","overview":"Enquanto Go-bi e o Sr. Park experimentam o novo item do menu, um arrogante crítico de café chega e incomoda os clientes.","air_date":"2021-11-14","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/9ui9RnTAWhkUwknZdb2bC4eEefb.jpg","vote_average":0},"8":{"name":"Hipster","overview":"Go-bi fica frustrado com um cliente que parece não ligar para café. Mas ninguém consegue entender por que ele sempre volta.","air_date":"2021-11-18","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/cEPLcRrX3VXfPqu6tD61kccgOG3.jpg","vote_average":0},"9":{"name":"Relativo, mas absoluto","overview":"Cliente fiel da cafeteria, Ahn Mi-na pede para ficar sozinha depois de se irritar com a mãe, que vai até lá e toma o café preferido da filha.","air_date":"2021-11-21","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/qVzpMEswmIqXsxin3ri4jZYSl8t.jpg","vote_average":0},"10":{"name":"Uma nova onda","overview":"O Sr. Park pede a Go-bi para visitar uma cafeteria importante. Enquanto isso, o locador do imóvel conta para o Sr. Park algo que vai mudar a vida de Go-bi.","air_date":"2021-11-25","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/oJ31NtU05RPpbuVDwzW6G4lRSek.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"N/A","air_date":"2021-11-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/1BW75vkTobnA6duebPgaY0SKtj8.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"N/A","air_date":"2021-12-02","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/fUMV5HwwVDduWtb6FSeXziUdhiT.jpg","vote_average":0}}}}},
