"233237":{"id":"233237","name":"Vozes da Segunda Guerra","slug":"vozes-da-segunda-guerra","original_title":"World War II: From the Frontlines","overview":"Com imagens de arquivo vividamente aprimoradas e vozes de todos os lados do conflito, esta série documental faz uma releitura inédita da Segunda Guerra Mundial.","first_air_date":"2023-12-07","episode_run_time":0,"vote_average":7.9,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["72 Films"],"genres":["Documentário","War & Politics"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/cw3S08Eh5LxnegXTQ8M2RVFNEa0.jpg","poster_path":"https://image.tmdb.org/t/p/original/15wIhM1X6oRiId0tPPTVoXLT6mx.jpg","cast":["John Boyega"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/uXj9j3IiZChdUkBRmTi2xREObx9.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/uXj9j3IiZChdUkBRmTi2xREObx9.jpg","air_date":"2023-12-07","episode_count":6,"overview":"Com imagens de arquivo vividamente aprimoradas e vozes de todos os lados do conflito, esta série documental faz uma releitura inédita da Segunda Guerra Mundial.","vote_average":7.5,"episodes":{"1":{"name":"A raça superior","overview":"1939–1940. A Alemanha já invadiu a Áustria e a Tchecoslováquia, mas é só quando Hitler toma a Polônia que a Segunda Guerra começa de verdade.","air_date":"2023-12-07","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/b143eV3hcy7URrUNOeTy0YJTAAc.jpg","vote_average":7.7},"2":{"name":"Dominar o mundo","overview":"1941. A guerra se intensifica, e as Potências do Eixo parecem incontroláveis. Hitler envia tropas à fronteira soviética para iniciar a Operação Barbarossa.","air_date":"2023-12-07","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/9KUnVMawH3bazMriwNh7mvRHhWA.jpg","vote_average":7.7},"3":{"name":"Ponto de inflexão","overview":"1942. A guerra engoliu o mundo inteiro e os alemães estão vencendo. Até que, lentamente, após a Batalha de Stalingrado, o jogo começa a virar.","air_date":"2023-12-07","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/f4uCjduZRoxXC9ZIxtmn7OVPHaw.jpg","vote_average":6.7},"4":{"name":"Fortaleza Europa","overview":"1943. Mudando de tática, os Aliados se arriscam em território inimigo. Apesar do bombardeio intenso, eles lutam para ganhar uma posição estratégica na Fortaleza Europa.","air_date":"2023-12-07","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/cyAjG5B5KHmh1fcFTUEfu9kKtxL.jpg","vote_average":7.7},"5":{"name":"Invasão","overview":"1944. Os Aliados decidem que invadir a Europa ocupada pelos nazistas é a única opção. No Dia D, cem mil soldados atravessam o Canal para retomar a França.","air_date":"2023-12-07","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/cV9b2dtlg61bd4LeyWEQwWHAIyZ.jpg","vote_average":7.7},"6":{"name":"A última tentativa","overview":"Em 1945, as Forças Aliadas chegam a Berlim, mas a Alemanha e o Japão não mostram sinais de desistência. Os Estados Unidos dão mais uma demonstração do seu poderio militar.","air_date":"2023-12-07","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/njvkRoPxvmaWzmEPDqqR92hYK8i.jpg","vote_average":7.7}}}}},
