"120911":{"id":"120911","name":"A Lista Terminal","slug":"a-lista-terminal","original_title":"The Terminal List","overview":"Depois que todo o seu pelotão das Forças de Operações Especiais da Marinha dos Estados Unidos (Navy SEALs) é emboscado durante uma missão secreta de alto risco, James Reece volta para casa com memórias conflitantes do evento e perguntas sobre sua culpa no acontecimento. No entanto, à medida que novas evidências vêm à tona, Reece descobre que forças obscuras estão trabalhando contra ele, colocando em risco não apenas sua vida, mas também a vida daqueles que ele ama.","first_air_date":"2022-06-30","episode_run_time":0,"vote_average":8.024,"number_of_seasons":1,"number_of_episodes":8,"created_by":["David DiGilio"],"production_companies":["Amazon Studios","Civic Center Media","MRC","Fuqua Films","Indivisible Productions","DiGilio Films"],"genres":["Action & Adventure","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/eqLwFXX0R7U0crdgQcj0Rxjb9uc.jpg","poster_path":"https://image.tmdb.org/t/p/original/zAqYuJQ0VKgLRtkdlRmMqQRvCHi.jpg","cast":["Chris Pratt","Constance Wu","Taylor Kitsch","Riley Keough","Arlo Mertz"],"trailer":"6qV0Lm-6lvE","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/zAqYuJQ0VKgLRtkdlRmMqQRvCHi.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/zAqYuJQ0VKgLRtkdlRmMqQRvCHi.jpg","air_date":"2022-06-30","episode_count":8,"overview":"N/A","vote_average":7.8,"episodes":{"1":{"name":"O Engrama","overview":"Na sequência de uma missão desastrosa no exterior, o comandante SEAL da Marinha, James Reece, volta para casa com memórias conflitantes da operação e perguntas sobre sua própria culpa.","air_date":"2022-06-30","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/xTX8MSqFJOuXYxQUjzvQcv8LyQi.jpg","vote_average":7.469},"2":{"name":"Codificação","overview":"Reece encontra seu primeiro alvo em potencial, contando com a ajuda de Ben. Com sua saúde mental sendo questionada, Katie e Reece iniciam uma parceria desconfortável, mas mutuamente benéfica para encontrar respostas.","air_date":"2022-06-30","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/g5wLIH3gip9bfL6qqR8jjmJpy8T.jpg","vote_average":7.652},"3":{"name":"Consolidação","overview":"Reece se envolve em uma conspiração complexa e coloca um novo nome em sua lista. Enquanto isso, a Secretária de Defesa Lorraine Hartley anuncia uma revisão drástica na política para ajudar os Agentes Especiais. E Katie descobre a verdade do que se passa na cabeça de Reece.","air_date":"2022-06-30","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/miAWQ17sRWlRnjjTULyYj8UDxAW.jpg","vote_average":7.455},"4":{"name":"Separação","overview":"Com a ajuda de seus amigos mais próximos, Reece viaja para o México para localizar o atirador que matou sua família. Katie continua sua pesquisa de um local remoto. Steve Horn toma medidas para preservar os negócios da Capstone, e a Força-Tarefa de Fugitivos do FBI de San Diego, liderada por Tony Layun, entra na briga em busca do perigoso SEAL James Reece.","air_date":"2022-06-30","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/4jAZoKxuawpXldOFaXQnIad7BMK.jpg","vote_average":7.7},"5":{"name":"Interrupção","overview":"Reece viaja para São Francisco em busca de respostas sobre uma droga que pode ter iniciado tudo isso. Katie tenta entregar Mike Tedesco em um esforço para impedir os planos da Capstone para a Newbellum. Tony e sua equipe ficam perto de Horn, esperando interceptar Reece antes que ele mate seu próximo alvo.","air_date":"2022-06-30","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/lUQ5pc7bN8MijNaXx87ZvItDWN2.jpg","vote_average":8.304},"6":{"name":"Transição","overview":"A caçada do FBI se intensifica à medida que eles se aproximam de Reece. Sem os medicamentos, os sintomas físicos e mentais de Reece aumentam. Cercado pela polícia, um homem empenhado em sua missão deve escapar sem tirar vidas inocentes.","air_date":"2022-06-30","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/h3GoK6KvqsieAVyhwSaOHOJwYWC.jpg","vote_average":8},"7":{"name":"Extinção","overview":"Reece retorna a Coronado para dar a cartada final nas pessoas que mais o traíram. De volta às paredes da casa de sua família, memórias fragmentadas vêm à tona. Katie coopera com o FBI para terminar sua história.","air_date":"2022-06-30","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/cnXLrzP6Fl2SqEe8wKhbMlRxAhk.jpg","vote_average":7.842},"8":{"name":"Reivindicação","overview":"Um confronto acontece na propriedade de Orcas Island, da Secretária de Defesa Hartley, quando os caminhos e objetivos de Reece, Katie, Ben e Tony se encontram.","air_date":"2022-06-30","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/bkEaP6MzheZndrdBYS8gxKym23x.jpg","vote_average":7.789}}}}},
