"220805":{"id":"220805","name":"Marc Márquez: All In","slug":"marc-marquez-all-in","original_title":"Marc Márquez: All In","overview":"Marc Márquez encara a decisão mais difícil de sua carreira. Ele precisará adotar medidas drásticas para tentar vencer de novo. A série retrata de forma direta e em primeira pessoa um ano decisivo na vida e na carreira de Marc. O medo, os riscos, o sofrimento, a emoção das corridas e a ambição infinita de um homem determinado a ser campeão novamente.","first_air_date":"2023-02-20","episode_run_time":34,"vote_average":6.7,"number_of_seasons":1,"number_of_episodes":5,"created_by":[],"production_companies":["Fast Brothers Productions A.I.E."],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/9tvYcoJ7olrdfi46ILGKyIbeaGD.jpg","poster_path":"https://image.tmdb.org/t/p/original/9aZj78irDjOzkh7xe8Alc0QOhsc.jpg","cast":["Marc Márquez","Dani Pedrosa","Jorge Lorenzo","Aleix Espargaró","Carlos Sainz Jr."],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9aZj78irDjOzkh7xe8Alc0QOhsc.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9aZj78irDjOzkh7xe8Alc0QOhsc.jpg","air_date":"2023-02-20","episode_count":5,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Esperança","overview":"Fevereiro de 2022. Marc Márquez já venceu mais do que a maioria das pessoas poderia sequer sonhar. Contudo, sua impressionante carreira é interrompida por uma lesão da qual ele não consegue se recuperar. Marc precisa mudar de rumo para enfrentar o maior desafio de sua monumental carreira: voltar a ser quem ele era. Para isso, decide mudar-se de Cervera, cidade onde sempre viveu, para Madrid.","air_date":"2023-02-20","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/oczcvMxG3FdU0CdtMxrB4elczFV.jpg","vote_average":0},"2":{"name":"Talento","overview":"O estilo de pilotagem de Marc lhe rendeu a admiração de milhões de fãs, mas também o levou a conflitos com outros pilotos. Se tem alguém que viu em primeira mão o talento e a ambição de Marc foi o seu irmão Álex, com quem ele mantém uma relação próxima. O ombro de Marc continua causando problemas. Ele tem um mau pressentimento e precisa tomar uma decisão.","air_date":"2023-02-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/j7QkPhFIM68HJ9amEvyBw0EHlMc.jpg","vote_average":0},"3":{"name":"Campeão","overview":"Marc decidiu. Para voltar a ser campeão, ele precisa ser operado mais uma vez. É o momento perfeito para voltar às origens e relembrar sua chegada ao MotoGP, ainda muito jovem, para enfrentar o homem que era seu ídolo na época: Valentino Rossi. Foi uma longa jornada desde então, e seu grande ídolo se tornou um grande rival.","air_date":"2023-02-20","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/iDGZolaqmlUi73bxcCvQZQvquBz.jpg","vote_average":0},"4":{"name":"Paixão","overview":"A cirurgia foi um sucesso. Ao acordar, ainda sedado, Marc profere algumas palavras que refletem o grande competidor que ele é, além de sua mentalidade em todos os momentos. Ele tenta mexer os dedos e suas primeiras palavras são: “Não consigo frear”. Ele começa a se recuperar com uma ideia em mente: vencer de novo. Ele visita sua equipe na Áustria, onde encontra seu ex-rival, Dani Pedrosa.","air_date":"2023-02-20","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/ghJWtnZeAxkk6L5IQQeMhQzW77R.jpg","vote_average":0},"5":{"name":"O Retorno","overview":"Marc volta a competir com bons pressentimentos, mas uma infeliz colisão na primeira curva o obriga a desistir. No entanto, suas sensações continuam melhorando e, nas últimas corridas do ano, Marc enfrenta o desafio de estar entre os primeiros colocados. É hora de recapitular e avaliar um ano em que Marc Márquez tomou algumas das decisões mais difíceis de sua vida.","air_date":"2023-02-20","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/7Nkk4F9hmAncmhQuSJINm8HxFyE.jpg","vote_average":0}}}}},
