"93265":{"id":"93265","name":"Aucademia","slug":"aucademia","original_title":"Pup Academy","overview":"Amigos peludos embarcam em uma jornada incrível nesta série sobre a extraordinária escola para os filhotes mais lindos, fofos e curiosos do mundo.","first_air_date":"2019-08-26","episode_run_time":25,"vote_average":7,"number_of_seasons":2,"number_of_episodes":19,"created_by":["Anna McRoberts"],"production_companies":[],"genres":["Kids","Comédia"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/d2jQm65UCUfAFul65lYvD43z7kC.jpg","poster_path":"https://image.tmdb.org/t/p/original/msMO8N3BAg2u2fYAeAZxcX7WX7D.jpg","cast":["Christian Convery","Chance Hurstfield","Travis Turner","Dylan Schombing"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/msMO8N3BAg2u2fYAeAZxcX7WX7D.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/msMO8N3BAg2u2fYAeAZxcX7WX7D.jpg","air_date":"2019-08-26","episode_count":12,"overview":"Amigos peludos embarcam em uma jornada incrível nesta série sobre uma escola extraordinária para os filhotes mais fofos e curiosos do mundo.","vote_average":9.3,"episodes":{"1":{"name":"Primeiro dia","overview":"O sábio C.A.O. recruta um novo grupo de alunos caninos, e as aulas começam. O jovem humano Morgan toma conhecimento da academia.","air_date":"2019-08-26","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/aILiaosvIZoFnPNjcwel7omYPeL.jpg","vote_average":7.8},"2":{"name":"Dia de falar sobre o seu humano","overview":"Os filhotes conversam sobre seus donos, mas Faísca não tem de quem falar. Será que ela consegue fingir para impressionar os professores e colegas?","air_date":"2019-09-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/fm6axvHm3HZy4QrA5vgNQRK8R1a.jpg","vote_average":0},"3":{"name":"Oopsie!","overview":"Um convidado surpresa desafia as regras e complica as coisas para Corazon. Morgan experimenta alguns equipamentos novos.","air_date":"2019-09-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tmcHb7cHKVDY3Pk4rmxFz2vu3g1.jpg","vote_average":0},"4":{"name":"Ciência culinária","overview":"Está difícil para Morgan achar tempo para ajudar na academia e dar conta das tarefas da escola. Os filhotes têm uma prova relâmpago, e começa o caos.","air_date":"2019-09-16","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/kqrMNcdt8PN2g9xEjfXzPLE9vSt.jpg","vote_average":10},"5":{"name":"Meu tio é Dude","overview":"Corazon tenta impressionar sua crush e fica em uma situação cão-plicada. Será que ele vai se redimir antes do show de talentos da Aucademia?","air_date":"2019-09-23","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/fhdYKgjT9ToWrIpDXxGr9dnbxQG.jpg","vote_average":0},"6":{"name":"Faísca foge","overview":"Um novo dia começa em Cabeça de Lobo. Faísca encontra King. Na academia, os filhotes aprendem sobre conversa de bebês.","air_date":"2019-09-30","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/drMOayTg1tOdkxeZFnPe7nTA0sU.jpg","vote_average":0},"7":{"name":"O documentário da Izzy","overview":"Izzy desconfia da rotina diária de Corazon. Charlie leva o C.A.O. para passar o dia fora e deixa uma longa lista de responsabilidades com Morgan.","air_date":"2019-10-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/cuKbqZGyTpJqx36sW7R1XyvNdQ6.jpg","vote_average":0},"8":{"name":"Miaucademia","overview":"Cachola, Corazon, Faísca e os outros filhotes aprendem a viver com seus inimigos naturais: gatos.","air_date":"2019-10-14","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/tChJ4LOmCuvhuuF5bwrQokNtVs5.jpg","vote_average":0},"9":{"name":"Entrando no Bosque Selvagem","overview":"Os filhotes formam duplas para uma caça ao tesouro na academia. Mas Morgan e Faísca se desviam do caminho, e as coisas ficam estranhas","air_date":"2019-10-21","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/6y2i3rnapxqekzdIa29W2A7r9Xd.jpg","vote_average":10},"10":{"name":"O segredo corre solto","overview":"Corazon não sabe como lidar com um acessório esquisito. Morgan e Izzy cometem um erro que ameaça o futuro fantástico da Aucademia.","air_date":"2019-10-28","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/be23axlYtTc3MiRJXgniXVN6Kof.jpg","vote_average":0},"11":{"name":"A substituta","overview":"Morgan está doente e não vai à Aucademia. Sua substituta tem um dia de aventuras. Os filhotes se divertem com uma coleção de pegadinhas criativas.","air_date":"2019-11-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/8vcywKBPbLboUjrmvF3Cm0f578k.jpg","vote_average":0},"12":{"name":"O passado do King","overview":"A Aucademia comemora um dia especial. O passado complicado de King vem à tona.","air_date":"2019-11-11","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/invj2NC1oag5rXqoixvSYjXdOoF.jpg","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2020-10-12","episode_count":7,"overview":"A Aucademia está de volta! Nesta temporada, os filhotes encaram uma terrível ameaça: um plano maligno para acabar com a amizade entre cães e humanos.","vote_average":9.5,"episodes":{"1":{"name":"O sumiço da constelação","overview":"A maior amizade do mundo corre risco quando a constelação que abastece a Aucademia se apaga e os humanos não querem mais os cachorros como seus melhores amigos.","air_date":"2020-10-12","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/kNtasTZjNqptxlwdKa8WRe4Dg7N.jpg","vote_average":9},"2":{"name":"Faísca quer voltar","overview":"Faísca explica seu lado da história após deixar a Aucademia, mas Corazon e Cachola logo descobrem que tudo não passava de um dos planos sinistros do Professor Fitz.","air_date":"2020-10-12","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/ynRTCJfmhE2BshGsGWuAVWD9HWu.jpg","vote_average":0},"3":{"name":"Dia da vira-lata","overview":"De acordo com a profecia da escola, todos acham que Faísca é a Escolhida. Mas como passou a vida toda na rua, ela não está acostumada a um tratamento especial.","air_date":"2020-10-12","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/q6zz6p51FPWHr0MTNShMgX0BYdS.jpg","vote_average":0},"4":{"name":"Que fedor!","overview":"Alguns convidados indesejados pretendem atrapalhar o evento anual da lua cheia. Mas Corazon tem uma arma secreta e fedorenta para impedi-los.","air_date":"2020-10-12","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/hBgNCjhzcZVaB1oeCeg8rIFdzeP.jpg","vote_average":0},"5":{"name":"O resgate do King","overview":"King é raptado de seu esconderijo, e os cachorros vão precisar se unir para salvá-lo do centro de controle de animais.","air_date":"2020-10-12","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/9mLelb4P2jnEIIjz1enqpk7huZE.jpg","vote_average":0},"6":{"name":"O troféu","overview":"A partida de hoje no campo de buscabol é Uivantes contra Rosnadores. Será que Faísca será a primeira vira-lata a levar o troféu, ou o título será novamente de Mordida?","air_date":"2020-10-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/9qA5aj2xxx5WYL1VnRDqc5oLCqw.jpg","vote_average":0},"7":{"name":"Formatura","overview":"Há semanas os cães de guarda não veem sinal de Lobo, mas C.A.O. tem a sensação de que algo de ruim pode arruinar o dia da formatura dos cãezinhos.","air_date":"2020-10-12","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/mXDa5f27u39gXf421CfiDyQ6fGT.jpg","vote_average":10}}}}},
